      <h2 style={{backgroundColor: '#4c2121', color: 'white', textAlign: 'left', width:335}}>Grow your business with us</h2>
       <img alt="HeroImg" width="50%" src="https://images.unsplash.com/photo-1536148935331-408321065b18?ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D&auto=format&fit=crop&w=387&q=80"/>
        
      </div>
    )
}

